function AirportCard ({ image, alt, title, price }) {
	return(

	<article className="card swiper-slide w-[286px] h-[440px] rounded-[12px] overflow-hidden flex flex-col justify-between group">
		<div className="cart-img">
			<img 
			src={image} 
			alt={alt} 
			/>
		</div>
 		<div className="card-text pt-6 font-bold">
			<h3 className="text-[18px] leading-[28px] pb-[16px] text-navy transition-colors duration-300">
			{title}
			</h3>
    		<p className="text-steel text-[16px] leading-[24px]">
				Airport Service Starting <br />
				from <span className="price text-skyblue font-bold">{price} </span> {currency}
   			</p>
 		</div>
	</article>


	);
}
export default AirportCard;
